import React from "react";
import {
  Link
} from "react-router-dom";
import '../folder_css/css_one'

export default function BasicExample() {
  return (
    
      <div className="CSS-Tab">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/dashboard">Dashboard</Link>
          </li>
        </ul>

        <hr />
      </div>
   
  );
}
